import s from "./Nav.module.css"
import {Link} from "react-router-dom";

function Nav(props) {
    return (
      <div className={s.nav_wrapper}>
        <div className={s.logo}>
          <h1>Logo</h1>
        </div>
        <div className={s.nav_menu}>
          <ul className="menu">
            <li><a href="#">Profile</a></li>
            <li><a href="#">Dialogs</a></li>
            <li><a href="#">Audio</a></li>
          </ul>
        </div>
      </div>
    );
}

export default Nav;
